import { Grommet, Tab, Tabs } from 'grommet';
import React from 'react';
import Foooter from './Foooter';
import Headerr from './Headerr';

export default function TabTile () {

    const theme = {
        global: {
          colors: {
            brand: '#01A982',
          },
          font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
          },
        },
      };

    return(
        <Grommet theme={theme}>
        <Headerr />
        <Tabs>
            <Tab title="Procurement" />
        </Tabs>
        <Foooter />
        </Grommet>
    ); 
}
